            <?php
            # La longitud máxima de la línea del CSV. Si no la sabes,
            # ponla en 0 pero la lectura será un poco más lenta
            $longitudDeLinea = 2000;
            $delimitador = ";"; # Separador de columnas
            $caracterCircundante = '"'; # A veces los valores son encerrados entre comillas
            $nombreArchivo = "../../datos/medidas_sanitarias/balance2.csv"; #Ruta del archivo, en este caso está junto a este script
            # Abrir el archivo
            $gestor = fopen($nombreArchivo, "r");
            if (!$gestor) {
                exit("No se puede abrir el archivo $nombreArchivo");
            }

            #  Comenzar a leer, $numeroDeFila es para llevar un índice
            $numeroDeFila = 1;
            $numeroAux = 1;
            $numeroAuxTitulo = 1;
            $data = array();
            while (!feof($gestor)) {
                $data[] = fgetcsv($gestor, $longitudDeLinea, $delimitador, $caracterCircundante);
            }

            echo "<table style='background-color: rgb(227, 232, 244);'>";
            #while (($fila = fgetcsv($gestor, $longitudDeLinea, $delimitador, $caracterCircundante)) !== false) {
            foreach ($data as $fila) {
                if ($numeroDeFila === 1) {
                    echo "<thead style='background-color: rgb(227, 232, 244);'>";
                }
                if ($numeroDeFila === 2) {
                    echo "<body>";
                }
                # Ahora $fila es un arreglo. Podríamos acceder al precio de compra en $fila[1]
                # porque los índices de los arreglos comienzan en 0
                echo "<tr>";
                foreach ($fila as $numeroDeColumna => $columna) {
                    if ($numeroDeFila === 1) {
                        if ($numeroAuxTitulo === 1) {
                            echo "<th style='background-color:#1C4A81; width:1em; border-radius: 1em 0em 0em 0em;'> $columna </th>";
                            $numeroAuxTitulo++;
                        } else if ($numeroAuxTitulo === 2) {
                            echo "<th style='background-color:#1C4A81; width:1em;'> $columna </th>";
                            $numeroAuxTitulo++;
                        } else if ($numeroAuxTitulo === 3) {
                            echo "<th style='background-color:#1C4A81; width:1em;'> $columna </th>";
                            $numeroAuxTitulo++;
                        } else if ($numeroAuxTitulo === 4) {
                            echo "<th style='background-color:#1C4A81; width:1em; border-radius: 0em 1em 0em 0em;'> $columna </th>";
                            $numeroAuxTitulo++;
                        } else if ($numeroAuxTitulo === 5) {
                            echo "<th style='background-color:#1C4A81; border-radius: 0em 1em 0em 0em;'> $columna </th>";
                            $numeroAuxTitulo++;
                        } else {
                            echo "<th> $columna </th>";
                        }
                    } else if ($numeroDeFila === 17) {
                        if ($numeroAux === 1) {
                            echo "<td style='color:#1C4A81; font-weight: bold; font-family:'font/gobCL'; '> $columna </td>";
                            $numeroAux = 2;
                        } else {
                            echo "<td style='text-align: -webkit-center; font-weight: bold; padding: 0; font-family:'font/gobCL';'> $columna </td>";
                        }
                    } else {
                        if ($numeroAux === 1) {
                            echo "<td style='color:#1C4A81; font-weight: 700; font-family:'font/gobCL';'> $columna </td>";
                            $numeroAux = 2;
                        } else {
                            echo "<td style='text-align: -webkit-center; padding: 0; font-family:'font/gobCL';'> $columna </td>";
                        }
                    }
                }
                echo "</tr>";
                if ($numeroDeFila === 1) {
                    echo "</thead>";
                }
                # Para separar la impresión
                # Aumentar el índice
                $numeroDeFila++;
                $numeroAux = 1;
                $numeroAuxTitulo = 1;
            }
            echo "</body>";
            echo "</table>";
            # Al finar cerrar el gestor
            fclose($gestor);
            ?>
